description:
Leverage is an American serial drama television series on TNT. It follows a group of criminals led by a former insurance investigator, who steal from rich companies and wealthy business men. It stars Timothy Hutton as Nate Ford, Christian Kane as Eliot Spencer, Aldis Hodge as Alec Hardison, Gina Bellman as Sophie Devereaux and Beth Riesgraf as Parker. Saul Rubinek guest-stars as Victor Dubenich in the pilot episode, filmed primarily in Chicago, Illinois. With 13 episodes commissioned, the series will begin airing on December 7th 2008. The series is produced by director/executive producer Dean Devlin's production company Electric Television, which recently produced two The Librarian TV movies for Turner Network Television (TNT).

